script: |
  super -f text -I q8624.spq | sort > q8624.out

inputs:
  - name: q8624.spq
    data: |
      SELECT DISTINCT + col2 AS col1, col0 + col0 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( - 68 - - col1 - + + col2 * - col0 + - - col2 ) = col0;
  - name: tab1

outputs:
  - name: q8624.out
    data: |
      59	170
      68	182
      96	102
